let splitRegAddr = function(regAddr, writeOffset ) {
    let type = Math.floor(regAddr / 10000);
    let addr = regAddr % 10000;
    let func = -1;

    if (writeOffset >=0) {
        if (type == 0) func = 5 + writeOffset;
        else if (type == 4) func = 6 + writeOffset;
    } else {
        if (type == 0) func = 1;
        else if (type == 1) func = 2;
        else if (type == 3) func = 4;
        else if (type == 4) func = 3;
    }

    return {
        func: func,
        addr: addr
    };
}


let getRegOne = function(modAddr, regAddr) {
    let funcAddr = splitRegAddr(regAddr, -1);
    if (funcAddr.func != -1) {
        let bytes = [];
        bytes.push(modAddr);
        bytes.push(funcAddr.func);
        bytes.push(funcAddr.addr >> 8 & 0xFF);
        bytes.push(funcAddr.addr & 0xFF);
